import { Cards } from '../Cards/Cards'
import { Table } from '../Table/Table'
import './MainDash.css'


export const MainDash = () => {
  return (
    <div className='MainDash'>
    <h1>Dashboard</h1>
    <Cards/>
    <h2>Recent Orders</h2> <Table/>
    
    
    
    </div>
  )
}
